import { TableRow, TableCell } from "@material-ui/core";

interface BookTableRowProps {
  id: number;
  author: string;
  bookName: string;
  copies?: number;
  isAvailable: boolean;
}

export function BookTableRow({ id, author, bookName, copies, isAvailable }: BookTableRowProps) {
  return (
    <TableRow>
      <TableCell>{bookName}</TableCell>
      <TableCell>{author}</TableCell>
      {copies && <TableCell>{copies}</TableCell>}
      {/* <TableCell>Status</TableCell> */}
      <TableCell>{isAvailable ? "Available" : "Not Available"}</TableCell>
    </TableRow>
  );
}
